(46, 1, '2020-04-30 19:00:47', '2020-04-30 19:00:47', '<!-- wp:heading {"level":4} -->\r\n<h4><span class="has-inline-color has-accent-color"><em><strong>B.Tech(Hons.)</strong></em></span></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph {"align":"left"} -->\r\n<p class="has-text-align-left"><strong><span class="has-inline-color has-accent-color">Institution:</span></strong> <em>Indian Institute of Information Technology,Ranchi</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p><strong><span class="has-inline-color has-accent-color">Period:</span></strong> <em>2018-2022</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p><span class="has-inline-color has-accent-color"><strong>GPA:</strong></span> <em>9.26</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><span class="has-inline-color has-accent-color"><em><strong>ISC</strong></em></span></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph {"align":"left"} -->\r\n<p class="has-text-align-left"><strong><span class="has-inline-color has-accent-color">Institution:</span></strong> <em>Tagore Academy,Jamshedpur</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p><strong><span class="has-inline-color has-accent-color">Period:</span></strong> <em>2016-2018</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p><span class="has-inline-color has-accent-color"><strong>Percentage Marks:</strong></span> <em>94.75%</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><span class="has-inline-color has-accent-color"><em><strong>ICSC</strong></em></span></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph {"align":"left"} -->\r\n<p class="has-text-align-left"><strong><span class="has-inline-color has-accent-color">Institution:</span></strong> <em>Tagore Academy,Jamshedpur</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p><strong><span class="has-inline-color has-accent-color">Period:</span></strong> <em>2015-2016</em></p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p><span class="has-inline-color has-accent-color"><strong>Percentage Marks:</strong></span> <em>95%</em></p>\r\n<!-- /wp:paragraph -->', 'Education', '', 'publish', 'closed', 'closed', '', 'education', '', '', '2020-09-17 02:06:08', '2020-09-17 02:06:08', '', 0, 'http://biograph.dx.am/?page_id=46', 0, 'page', '', 0),
