(28, 1, '2020-08-11 08:41:45', '2020-08-11 08:41:45', '<!-- wp:group {"align":"wide"} -->\n<div class="wp-block-group alignwide"><div class="wp-block-group__inner-container"><!-- wp:heading {"align":"center","level":3} -->\n<h3 class="has-text-align-center">Prithwiraj Samanta</h3>\n<!-- /wp:heading --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:image {"align":"center","id":32,"width":345,"height":378,"sizeSlug":"large","className":"is-style-rounded"} -->\n<div class="wp-block-image is-style-rounded"><figure class="aligncenter size-large is-resized"><img src="http://biograph.dx.am/wp-content/uploads/2020/04/face.png.jpg" alt="" class="wp-image-32" width="345" height="378"/></figure></div>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:group -->\n<div class="wp-block-group"><div class="wp-block-group__inner-container"><!-- wp:paragraph {"align":"left"} -->\n<p class="has-text-align-left"><em><span class="has-inline-color has-secondary-color">A passionate coder with keen interest in development of highly responsive and user friendly websites and applications for several platforms.</span></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em><span class="has-inline-color has-secondary-color">Learning data science as hobby. Started cloud engineering & architecture studies amid of Covid-19 to empower vision and creativity.</span></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em><span class="has-inline-color has-secondary-color">Proficient in various programming languages, frameworks and libraries.</span></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em><span class="has-inline-color has-secondary-color">A person who loves travelling and never fails to make people laugh, and with ability to work in a fast paced environment.</span></em></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:group {"align":"wide"} -->\n<div class="wp-block-group alignwide"><div class="wp-block-group__inner-container"><!-- wp:paragraph {"align":"left"} -->\n<p class="has-text-align-left"><strong><span class="has-inline-color has-accent-color">A B.Tech(CSE) undergraduate from Indian Institute of Information Technology</span></strong></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', '', '', 'inherit', 'closed', 'closed', '', '6-autosave-v1', '', '', '2020-08-11 08:41:45', '2020-08-11 08:41:45', '', 6, 'http://biograph.dx.am/2020/04/30/6-autosave-v1/', 0, 'revision', '', 0),
(74, 1, '2020-05-01 07:11:43', '2020-05-01 07:11:43', '<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Web Team(IIIT-R)</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul><li><em><span class="has-inline-color has-secondary-color">Maintenance of institute website</span></em></li><li><em><span class="has-inline-color has-secondary-color">Updating content of institute website</span></em></li></ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">App-Web Community Coordinator(HOG)</span><span class="has-inline-color has-accent-color"></span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul><li>Organizing different events</li><li>Forming and maintaining different teams</li><li>Induction and training of community members</li></ul>\r\n<!-- /wp:list -->', 'Responsibilities', '', 'inherit', 'closed', 'closed', '', '55-revision-v1', '', '', '2020-05-01 07:11:43', '2020-05-01 07:11:43', '', 55, 'http://biograph.dx.am/2020/05/01/55-revision-v1/', 0, 'revision', '', 0),
