(29, 1, '2020-04-30 18:26:06', '2020-04-30 18:26:06', '<!-- wp:group {"align":"wide"} -->\r\n<div class="wp-block-group alignwide">\r\n<div class="wp-block-group__inner-container"><!-- wp:heading {"align":"center"} -->\r\n<h2 class="has-text-align-center">The premier destination for modern art in Northern Sweden. Open from 10 AM to 6 PM every day during the summer months.</h2>\r\n<!-- /wp:heading --></div>\r\n</div>\r\n<!-- /wp:group -->\r\n\r\n<!-- wp:columns {"align":"wide"} -->\r\n<div class="wp-block-columns alignwide"><!-- wp:column -->\r\n<div class="wp-block-column"><!-- wp:group -->\r\n<div class="wp-block-group">\r\n<div class="wp-block-group__inner-container"><!-- wp:image {"align":"full","id":37,"sizeSlug":"full"} -->\r\n<figure class="wp-block-image alignfull size-full"><img class="wp-image-37" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-1.png" alt="" /></figure>\r\n<!-- /wp:image -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3>Works and Days</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>August 1 -- December 1</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:button {"className":"is-style-outline"} -->\r\n<div class="wp-block-button is-style-outline"><a class="wp-block-button__link" href="https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/">Read More</a></div>\r\n<!-- /wp:button --></div>\r\n</div>\r\n<!-- /wp:group -->\r\n\r\n<!-- wp:group -->\r\n<div class="wp-block-group">\r\n<div class="wp-block-group__inner-container"><!-- wp:image {"align":"full","id":37,"sizeSlug":"full"} -->\r\n<figure class="wp-block-image alignfull size-full"><img class="wp-image-37" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-3.png" alt="" /></figure>\r\n<!-- /wp:image -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3>Theatre of Operations</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>October 1 -- December 1</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:button {"className":"is-style-outline"} -->\r\n<div class="wp-block-button is-style-outline"><a class="wp-block-button__link" href="https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/">Read More</a></div>\r\n<!-- /wp:button --></div>\r\n</div>\r\n<!-- /wp:group --></div>\r\n<!-- /wp:column -->\r\n\r\n<!-- wp:column -->\r\n<div class="wp-block-column"><!-- wp:group -->\r\n<div class="wp-block-group">\r\n<div class="wp-block-group__inner-container"><!-- wp:image {"align":"full","id":37,"sizeSlug":"full"} -->\r\n<figure class="wp-block-image alignfull size-full"><img class="wp-image-37" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-2.png" alt="" /></figure>\r\n<!-- /wp:image -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3>The Life I Deserve</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>August 1 -- December 1</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:button {"className":"is-style-outline"} -->\r\n<div class="wp-block-button is-style-outline"><a class="wp-block-button__link" href="https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/">Read More</a></div>\r\n<!-- /wp:button --></div>\r\n</div>\r\n<!-- /wp:group -->\r\n\r\n<!-- wp:group -->\r\n<div class="wp-block-group">\r\n<div class="wp-block-group__inner-container"><!-- wp:image {"align":"full","id":37,"sizeSlug":"full"} -->\r\n<figure class="wp-block-image alignfull size-full"><img class="wp-image-37" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-three-quarters-4.png" alt="" /></figure>\r\n<!-- /wp:image -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3>From Signac to Matisse</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>October 1 -- December 1</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:button {"className":"is-style-outline"} -->\r\n<div class="wp-block-button is-style-outline"><a class="wp-block-button__link" href="https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/">Read More</a></div>\r\n<!-- /wp:button --></div>\r\n</div>\r\n<!-- /wp:group --></div>\r\n<!-- /wp:column --></div>\r\n<!-- /wp:columns -->\r\n\r\n<!-- wp:image {"align":"full","id":37,"sizeSlug":"full"} -->\r\n<figure class="wp-block-image alignfull size-full"><img class="wp-image-37" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-landscape-2.png" alt="" /></figure>\r\n<!-- /wp:image -->\r\n\r\n<!-- wp:group {"align":"wide"} -->\r\n<div class="wp-block-group alignwide">\r\n<div class="wp-block-group__inner-container"><!-- wp:heading {"align":"center","textColor":"accent"} -->\r\n<h2 class="has-accent-color has-text-align-center">Cyborgs, as the philosopher Donna Haraway established, are not reverent. They do not remember the cosmos.</h2>\r\n<!-- /wp:heading --></div>\r\n</div>\r\n<!-- /wp:group -->\r\n\r\n<!-- wp:paragraph {"dropCap":true} -->\r\n<p class="has-drop-cap">With seven floors of striking architecture, UMoMA shows exhibitions of international contemporary art, sometimes along with art historical retrospectives. Existential, political and philosophical issues are intrinsic to our programme. As visitor you are invited to guided tours artist talks, lectures, film screenings and other events with free admission</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>The exhibitions are produced by UMoMA in collaboration with artists and museums around the world and they often attract international attention. UMoMA has received a Special Commendation from the European Museum of the Year, and was among the top candidates for the Swedish Museum of the Year Award as well as for the Council of Europe Museum Prize.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:group {"customBackgroundColor":"#ffffff","align":"wide"} -->\r\n<div class="wp-block-group alignwide has-background" style="background-color: #ffffff;">\r\n<div class="wp-block-group__inner-container"><!-- wp:group -->\r\n<div class="wp-block-group">\r\n<div class="wp-block-group__inner-container"><!-- wp:heading {"align":"center"} -->\r\n<h2 class="has-text-align-center">Become a Member and Get Exclusive Offers!</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph {"align":"center"} -->\r\n<p class="has-text-align-center">Members get access to exclusive exhibits and sales. Our memberships cost $99.99 and are billed annually.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:button {"align":"center"} -->\r\n<div class="wp-block-button aligncenter"><a class="wp-block-button__link" href="https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/">Join the Club</a></div>\r\n<!-- /wp:button --></div>\r\n</div>\r\n<!-- /wp:group --></div>\r\n</div>\r\n<!-- /wp:group -->\r\n\r\n<!-- wp:gallery {"ids":[39,38],"align":"wide"} -->\r\n<figure class="wp-block-gallery alignwide columns-2 is-cropped">\r\n<ul class="blocks-gallery-grid">\r\n<li class="blocks-gallery-item">\r\n<figure><img class="wp-image-39" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-square-2.png" alt="" data-id="39" data-full-url="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-square-2.png" data-link="assets/images/2020-square-2/" /></figure>\r\n</li>\r\n<li class="blocks-gallery-item">\r\n<figure><img class="wp-image-38" src="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-square-1.png" alt="" data-id="38" data-full-url="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-square-1.png" data-link="http://biograph.dx.am/wp-content/themes/twentytwenty/assets/images/2020-square-1/" /></figure>\r\n</li>\r\n</ul>\r\n</figure>\r\n<!-- /wp:gallery -->', 'Prithwiraj\'s Portfolio', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2020-04-30 18:26:06', '2020-04-30 18:26:06', '', 6, 'http://biograph.dx.am/2020/04/30/6-revision-v1/', 0, 'revision', '', 0),
