(49, 1, '2020-04-30 19:01:08', '2020-04-30 19:01:08', '<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Coding Language</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Web</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>JavaScript</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>PHP</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">App</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Java</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>C++</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>C#</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Python</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Kotlin</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Technology</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Web</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>LAMP</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>MongoDB+MySQL</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>HTML+CSS</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Bootstrap</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>ReactJS</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>JQuery</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>GraphQL(Graphene+Apollo)</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>WordPress</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Node-Red</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">App</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>ExpressJS</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>NodeJS</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Flutter</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Firebase</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>React-native</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Django</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Android</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Tkinter</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Phonegap</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Graphics</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Design</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>AutoCad</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Illustrator</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Animation</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>AutoDesk Maya</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Unity</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Artificial Intelligence</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Languages</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Python</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Java</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Libraries</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Sklearn</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Matplotlib</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Pandas</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Spacy</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Numpy</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Keras</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Tensorflow</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} --