tion</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Maya</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Unity</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Artificial Intelligence</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Languages</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Python</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Java</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Libraries</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Sklearn</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color">Matplotlib</span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Pandas</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Spacy</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Numpy</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color">Keras</span></li>\r\n<li><span class="has-inline-color has-secondary-color">Neuroph</span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:heading {"level":4} -->\r\n<h4><strong><span class="has-inline-color has-accent-color">Hands-On</span></strong></h4>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Natural language Processing</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color">Text Classification</span></li>\r\n<li><span class="has-inline-color has-secondary-color">Sound Classification</span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">IT Automation</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Automating with Python</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Testing and Debugging</span></em></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Cloud Computing(GCE and AWS)</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Configuration Management(Puppet)</span></em></li></ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Minorities</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Enterprise Design</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Cryptography</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Containar(Docker)</span></em></li>\r\n<li><em><span class="has-inline-color has-secondary-color">VCS(Git)</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->', 'Experience', '', 'inherit', 'closed', 'closed', '', '49-revision-v1', '', '', '2020-06-23 19:27:55', '2020-06-23 19:27:55', '', 49, 'http://biograph.dx.am/2020/06/23/49-revision-v1/', 0, 'revision', '', 0),
