nline-color has-secondary-color"><em>Natural language Processing</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Text Classification</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Sound Classification</em></span></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Cloud <br /></span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Scaling and Automation(Python)</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Testing and Debugging(Python)</span></em></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Core Infrastructure and Services(GCE, AWS, IBM)<br /></em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Configuration Management(Puppet)</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {"level":3} -->\r\n<h3><strong><span class="has-inline-color has-accent-color">Minorities</span></strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li><span class="has-inline-color has-secondary-color"><em>Enterprise Design(IBM)</em></span></li>\r\n<li><span class="has-inline-color has-secondary-color"><em>Cryptography</em></span></li>\r\n<li><em><span class="has-inline-color has-secondary-color">Containar(Docker)</span></em></li>\r\n<li><em><span class="has-inline-color has-secondary-color">VCS(Git)</span></em></li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->', 'Experience', '', 'inherit', 'closed', 'closed', '', '49-revision-v1', '', '', '2020-08-28 09:14:53', '2020-08-28 09:14:53', '', 49, 'http://biograph.dx.am/2020/08/28/49-revision-v1/', 0